    /// </summary>
    public class BarBox: Image
    {
        private ImageSource internalSource;
        private DesignType currentDesignType;
        private ColorUI currentColor;
        private StateCollapseBox currentState;

        /// <summary>
        /// Constructor of BarBox
        /// </summary>
        public BarBox(string hash, DesignType designType, ColorUI color, StateCollapseBox state)
        {
            if (hash != "__Laavor*+-///qwertyuiiii23444UUUU+=@33%%*&¨VVVMMad13,a,a8d939kl")
            {
                throw new Exception("Key in Invalid in Constructor");
            }

            currentDesignType = designType;
            currentColor = color;
            currentState = state;

            Aspect = Aspect.Fill;

            byte[] imageBytes = Convert.FromBase64String(GetColor(currentDesignType, currentColor, currentState));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

        /// <summary>
        /// Change State
        /// </summary>
        public void ChangeState(string hash, StateCollapseBox state)
        {
            currentState = state;
            byte[] imageBytes = Convert.FromBase64String(GetColor(currentDesignType, currentColor, currentState));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

        /// <summary>
        /// Change ColorUI
        /// </summary>
        public void ChangeColorUI(string hash, ColorUI color)
        {
            currentColor = color;
            byte[] imageBytes = Convert.FromBase64String(GetColor(currentDesignType, currentColor, currentState));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

        /// <summary>
        /// Change DesignType
        /// </summary>
        public void ChangeDesignType(string hash, DesignType designType)
        {
            currentDesignType = designType;
            byte[] imageBytes = Convert.FromBase64String(GetColor(currentDesignType, currentColor, currentState));
            var streamImage = new System.IO.MemoryStream(imageBytes);

            this.internalSource = ImageSource.FromStream(() => streamImage);
            Source = internalSource;
        }

        
