        private string GetColor(DesignType typeS, ColorUI color, StateCollapseBox state)
        {
            MethodInfo methodToInvoke = this.GetType().GetMethod("GetImageTitle" + typeS.ToString(), BindingFlags.NonPublic | BindingFlags.Instance);

            object[] parametersInvoke = { color, state };

            var returnStringColor = (string)methodToInvoke.Invoke(this, parametersInvoke);
            return returnStringColor;
        }
